  [],\n\t\"revision_timestamp\": \"2016-02-27T17:19:05.173592\",\n\t\"name\": \"state-childrens-health-insurance-program-schip\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The SCHIP project implements the legislative
  requirements of Public Law 111-3, which requires SSA to provide a means for states
  to check SSA's records to see if they contain data to support an allegation of U.S.
  citizenship for new applicants under these programs. SCHIP records come into SSA
  via the State Verification and Exchange System (SVES). SVES records are processed
  through EVS Processing Code 322 for verification. EVS matches the applicant's Names
  and SSNs to the NUMIDENT and returns the information back to SVES. For SCHIP, EVS
  will also obtain citizenship data from the NUMIDENT. SVES returns a response code
  to the state indication whether SSA records are consistent with an allegation of
  U.S. citizenship.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
